  \"In situ, navigational, physical and profile data collected by Royal Netherlands
  Institute for Sea Research at OceanSITES site LOCO-MOZCHANNEL from 0103-11-16 to
  8159-12-18 (NCEI Accession 0130742)\",\n\t\"tracking_summary\": {\n\t\t\"total\":
  1,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-02-26T22:16:15.049829\",\n\t\"name\": \"in-situ-navigational-physical-and-profile-data-collected-by-royal-netherlands-institute-fo\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"In situ, navigational, physical and profile
  oceanographic data were collected, including CONDUCTIVITY, CURRENT DIRECTION, CURRENT
  SPEED, CURRENT SPEED - EAST/WEST COMPONENT (U), CURRENT SPEED - NORTH/SOUTH COMPONENT
  (V), DEPTH - OBSERVATION, HYDROSTATIC PRESSURE, LATITUDE, LONGITUDE, SALINITY and
  WATER TEMPERATURE from Moored Buoy at the Long-Term Ocean Climate Observations (LOCO)
  Mozambique Channel moorings (LOCO-MOZCHANNEL) using ADCP, C-T recorder, current
  meter and thermistor from 0103-11-16 to 8159-12-18. These data were provided to
  one of the OceanSITES Data Assembly Centers (DAC). The DAC formatted this information
  into the OceanSITES file format and passed it on to the Global Data Assembly Centers
  (GDAC).OceanSITES is a worldwide system of long-term, open-ocean reference stations
  measuring dozens of variables and monitoring the full depth of the ocean from air-sea
  interactions down to the seafloor. It is a network of stations or observatories
  measuring many aspects of the ocean's surface and water column using, where possible,
  automated systems with advanced sensors and telecommunications systems, yielding
  high time resolution, often in real-time, while building a long record.\",\n\t\"license_title\":
